import React from "react";

import { motion, AnimatePresence,useAnimation } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { ReactComponent as Logo } from "../../../img/logo/logo.svg";

const defaulUI: React.FC = ()=>{
    return(
        <div className="project-maker-init">
            <motion.div 
            initial={{ 
                height: 0,
            }} 
            animate={{ 
                height: 80,
                y : 0,
                
            }}
            transition={{ 
                duration: 1,
                ease: "anticipate",
                delay : 0.5
            }}
            className="head">  
            <motion.div 
                initial = {{opacity : 0}} animate = {{opacity : 1}} transition={{duration : 1, ease : "easeInOut", delay : 1,}}
                className="prev">
                    
            </motion.div>

            <motion.div 
                initial = {{opacity : 0}} animate = {{opacity : 1}} transition={{duration : 1, ease : "easeInOut", delay : 1,}}
                className="head-logo"><Logo />
            </motion.div>
            
            </motion.div>  

            <div className="contents">
                <div className="t">
                    <h1></h1>
                    <p></p>
                </div>
                <div className="user-interaction"></div>
            </div>
        </div>
    )
}
export default defaulUI;
